export const standardizeWorkout = workout => {
  if (!workout || typeof workout !== 'object') {
    console.error('Invalid workout object:', workout);
    return null;
  }

  return {
    id:
      typeof workout.id === 'object' ? workout.id.toString() : workout.id || '',
    name: workout.name || '',
    programId:
      typeof workout.programId === 'object'
        ? workout.programId.toString()
        : workout.programId || '',
    exercises: Array.isArray(workout.exercises) ? workout.exercises : [],
    order: typeof workout.order === 'number' ? workout.order : 1
  };
};
